<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Lumi Dashboard</title>
<link href="https://fonts.googleapis.com/css2?family=Inter:wght@400;500;600&family=Space+Grotesk:wght@600;700&display=swap" rel="stylesheet">
<style>
  * { margin: 0; padding: 0; box-sizing: border-box; }
  .vault-overlay {
    position: fixed; inset: 0; z-index: 99999;
    display: flex; align-items: center; justify-content: center;
    background: radial-gradient(ellipse at 50% 40%, #0f1628 0%, #070a12 70%);
    font-family: 'Inter', -apple-system, BlinkMacSystemFont, 'Segoe UI', system-ui, sans-serif;
  }
  .vault-card {
    background: linear-gradient(145deg, rgba(20,20,35,0.95), rgba(12,12,22,0.98));
    border: 1px solid rgba(124,111,247,0.15);
    border-radius: 20px;
    padding: 48px 40px;
    max-width: 380px; width: 90%;
    text-align: center;
    box-shadow: 0 24px 80px rgba(0,0,0,0.6), 0 0 60px rgba(124,79,255,0.06);
    backdrop-filter: blur(20px);
  }
  .vault-logo {
    margin-bottom: 16px;
  }
  .vault-logo svg {
    width: 56px; height: 56px;
    filter: drop-shadow(0 0 12px rgba(0,188,212,0.3));
  }
  .vault-title {
    font-family: 'Space Grotesk', sans-serif;
    color: #e0e0e8; font-size: 22px; font-weight: 700;
    margin-bottom: 2px;
    background: linear-gradient(135deg, #00bcd4, #7c4dff);
    -webkit-background-clip: text;
    -webkit-text-fill-color: transparent;
  }
  .vault-sub {
    color: #5a5a6a; font-size: 12px; margin-bottom: 32px;
    text-transform: uppercase; letter-spacing: 2px; font-weight: 500;
  }
  .vault-input {
    width: 100%; box-sizing: border-box;
    padding: 14px 16px; font-size: 15px;
    font-family: 'Inter', sans-serif;
    background: rgba(10,10,18,0.8); color: #e0e0e8;
    border: 1px solid rgba(124,111,247,0.2); border-radius: 12px;
    outline: none; transition: border-color 0.2s, box-shadow 0.2s;
  }
  .vault-input:focus {
    border-color: rgba(124,111,247,0.5);
    box-shadow: 0 0 20px rgba(124,79,255,0.1);
  }
  .vault-input.error { border-color: #ef4444; animation: shake 0.4s; }
  @keyframes shake {
    0%,100% { transform: translateX(0); }
    25% { transform: translateX(-6px); }
    75% { transform: translateX(6px); }
  }
  .vault-remember {
    display: flex; align-items: center; justify-content: center;
    gap: 8px; margin: 16px 0 28px;
    color: #5a5a6a; font-size: 12px; cursor: pointer;
    user-select: none;
  }
  .vault-remember input {
    accent-color: #7c6ff7; width: 14px; height: 14px; cursor: pointer;
  }
  .vault-btn {
    width: 100%; padding: 14px;
    background: linear-gradient(135deg, #00bcd4, #7c4dff);
    color: #fff;
    border: none; border-radius: 12px;
    font-size: 14px; font-weight: 600; font-family: 'Inter', sans-serif;
    cursor: pointer; transition: opacity 0.2s, transform 0.1s;
    letter-spacing: 0.5px;
  }
  .vault-btn:hover { opacity: 0.9; }
  .vault-btn:active { transform: scale(0.98); }
  .vault-btn:disabled { opacity: 0.4; cursor: wait; }
  .vault-error {
    color: #ef4444; font-size: 12px;
    margin-top: 14px; min-height: 18px;
  }
</style>
</head>
<body>
<div class="vault-overlay" id="vault-overlay">
  <div class="vault-card">
    <div class="vault-logo">
      <svg viewBox="0 0 56 56" fill="none" xmlns="http://www.w3.org/2000/svg">
        <defs>
          <linearGradient id="vg" x1="0" y1="0" x2="56" y2="56" gradientUnits="userSpaceOnUse">
            <stop offset="0%" stop-color="#00bcd4"/>
            <stop offset="100%" stop-color="#7c4dff"/>
          </linearGradient>
          <linearGradient id="vi" x1="18" y1="16" x2="38" y2="40" gradientUnits="userSpaceOnUse">
            <stop offset="0%" stop-color="#26c6da"/>
            <stop offset="100%" stop-color="#a78bfa"/>
          </linearGradient>
        </defs>
        <path d="M28 4 L49 16 L49 40 L28 52 L7 40 L7 16 Z" stroke="url(#vg)" stroke-width="1.5" fill="none" opacity="0.4"/>
        <path d="M28 10 L44 19 L44 37 L28 46 L12 37 L12 19 Z" stroke="url(#vg)" stroke-width="1.5" fill="none" opacity="0.7"/>
        <circle cx="28" cy="28" r="8" fill="url(#vi)" opacity="0.85"/>
        <circle cx="28" cy="28" r="3" fill="white" opacity="0.7"/>
      </svg>
    </div>
    <div class="vault-title">Lumi</div>
    <div class="vault-sub">Personal OS</div>
    <input type="password" class="vault-input" id="vault-pass"
           placeholder="Passphrase" autocomplete="off" autofocus>
    <label class="vault-remember">
      <input type="checkbox" id="vault-remember" checked>
      Remember on this device
    </label>
    <button class="vault-btn" id="vault-btn" onclick="vaultUnlock()">
      Unlock
    </button>
    <div class="vault-error" id="vault-error"></div>
  </div>
</div>

var VAULT_KEY = "lumi_vault_key";
var VAULT_HEAD = "\n    <meta charset=\"UTF-8\">\n    <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\n    <meta http-equiv=\"refresh\" content=\"60\">\n    <meta name=\"robots\" content=\"noindex, nofollow, noarchive\">\n    <title>Lumi Dashboard</title>\n    <link rel=\"preconnect\" href=\"https://fonts.googleapis.com\">\n    <link rel=\"preconnect\" href=\"https://fonts.gstatic.com\" crossorigin>\n    <link href=\"https://fonts.googleapis.com/css2?family=Inter:wght@400;500;600;700&family=Space+Grotesk:wght@500;600;700&display=swap\" rel=\"stylesheet\">\n    <style>\n        /* === Theme variables === */\n        :root {\n          --bg-body: #0b1222;\n          --bg-card: #111827;\n          --bg-elevated: #1e293b;\n          --bg-inset: #0b1222;\n          --bg-hover: #1e293b;\n\n          --border-default: #1e293b;\n          --border-subtle: #334155;\n\n          --text-primary: #e2e8f0;\n          --text-secondary: #94a3b8;\n          --text-muted: #64748b;\n          --text-faint: #475569;\n\n          --accent-cyan: #00bcd4;\n          --accent-cyan-hover: #26c6da;\n          --accent-cyan-bg: #083344;\n          --accent-cyan-deep: #164e63;\n          --accent-purple: #7c3aed;\n          --accent-purple-bg: #1e1b4b;\n\n          --success: #22c55e;\n          --success-bg: #052e16;\n          --success-text: #4ade80;\n          --warning: #ff6b35;\n          --warning-bg: #3d1c00;\n          --warning-text: #ff8a65;\n          --danger: #ef4444;\n          --danger-bg: #450a0a;\n          --danger-text: #f87171;\n          --info: #ffc107;\n          --info-bg: #3d2e00;\n\n          --shadow-color: rgba(0,0,0,0.2);\n          --shadow-heavy: rgba(0,0,0,0.35);\n          --overlay: rgba(0,0,0,0.4);\n\n          --gradient-start: #00bcd4;\n          --gradient-end: #7c4dff;\n\n          --scrollbar-thumb: #334155;\n          --scrollbar-hover: #475569;\n        }\n\n        [data-theme=\"light\"] {\n          --bg-body: #f8fafc;\n          --bg-card: #ffffff;\n          --bg-elevated: #f1f5f9;\n          --bg-inset: #e2e8f0;\n          --bg-hover: #f1f5f9;\n\n          --border-default: #e2e8f0;\n          --border-subtle: #cbd5e1;\n\n          --text-primary: #1e293b;\n          --text-secondary: #475569;\n          --text-muted: #64748b;\n          --text-faint: #94a3b8;\n\n          --accent-cyan: #0891b2;\n          --accent-cyan-hover: #0e7490;\n          --accent-cyan-bg: #ecfeff;\n          --accent-cyan-deep: #cffafe;\n          --accent-purple: #6d28d9;\n          --accent-purple-bg: #ede9fe;\n\n          --success: #16a34a;\n          --success-bg: #f0fdf4;\n          --success-text: #15803d;\n          --warning: #ea580c;\n          --warning-bg: #fff7ed;\n          --warning-text: #c2410c;\n          --danger: #dc2626;\n          --danger-bg: #fef2f2;\n          --danger-text: #b91c1c;\n          --info: #d97706;\n          --info-bg: #fffbeb;\n\n          --shadow-color: rgba(0,0,0,0.06);\n          --shadow-heavy: rgba(0,0,0,0.1);\n          --overlay: rgba(0,0,0,0.15);\n\n          --gradient-start: #0891b2;\n          --gradient-end: #6d28d9;\n\n          --scrollbar-thumb: #cbd5e1;\n          --scrollbar-hover: #94a3b8;\n        }\n\n        /* Smooth theme transitions */\n        body, .sidebar, .main, .page, .card, .stat-card, .kanban-column,\n        .kanban-card, .course-card, .nav-item, .nav-sub-item, .dioe-section,\n        .oe-panel, .briefing-day, .briefing-section, .material-item,\n        a.material-item, .week-detail, .course-index-card, .memory-card,\n        .timeline-entry, .cap-card, input, textarea, select, button {\n            transition: background-color 0.3s ease, color 0.3s ease,\n                        border-color 0.3s ease, box-shadow 0.3s ease;\n        }\n\n        /* Theme toggle button */\n        .theme-toggle-btn {\n            background: var(--bg-elevated);\n            border: 1px solid var(--border-subtle);\n            border-radius: 6px;\n            padding: 4px 8px;\n            cursor: pointer;\n            font-size: 16px;\n            line-height: 1;\n            color: var(--text-muted);\n        }\n        .theme-toggle-btn:hover {\n            border-color: var(--accent-cyan);\n            color: var(--text-primary);\n        }\n        .theme-icon-moon { display: none; }\n        [data-theme=\"light\"] .theme-icon-sun { display: none; }\n        [data-theme=\"light\"] .theme-icon-moon { display: inline; }\n\n        /* German immersion toggle */\n        .lang-toggle-btn {\n            background: var(--bg-elevated);\n            border: 1px solid var(--border-subtle);\n            border-radius: 6px;\n            padding: 4px 8px;\n            cursor: pointer;\n            font-size: 11px;\n            font-weight: 600;\n            line-height: 1;\n            color: var(--text-muted);\n            margin-left: 4px;\n            letter-spacing: 0.3px;\n        }\n        .lang-toggle-btn:hover {\n            border-color: var(--accent-cyan);\n            color: var(--text-primary);\n        }\n        .lang-toggle-btn.active {\n            background: linear-gradient(135deg, var(--accent-cyan), var(--accent-purple));\n            color: #fff;\n            border-color: transparent;\n        }\n\n        * { margin: 0; padding: 0; box-sizing: border-box; }\n        body {\n            font-family: 'Inter', -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, sans-serif;\n            background: var(--bg-body);\n            color: var(--text-primary);\n            min-height: 100vh;\n            display: flex;\n        }\n        h1, h2, h3, h4, h5, h6, .section-title, .sidebar-title, .stat-card .number {\n            font-family: 'Space Grotesk', -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, sans-serif;\n        }\n        a { color: var(--accent-cyan); text-decoration: none; }\n        a:hover { text-decoration: underline; color: var(--accent-cyan-hover); }\n\n        /* --- Sidebar --- */\n        .sidebar {\n            width: 240px;\n            min-width: 240px;\n            background: var(--bg-card);\n            border-right: 1px solid var(--border-default);\n            padding: 0;\n            display: flex;\n            flex-direction: column;\n            position: fixed;\n            top: 0; left: 0; bottom: 0;\n            z-index: 50;\n        }\n        .sidebar-brand {\n            padding: 20px 20px 16px;\n            border-bottom: 1px solid var(--border-default);\n            display: flex;\n            align-items: center;\n            gap: 12px;\n        }\n        .sidebar-brand .brand-logo {\n            width: 36px; height: 36px; flex-shrink: 0;\n        }\n        .sidebar-brand .brand-text h1 {\n            font-size: 18px; font-weight: 700; line-height: 1;\n        }\n        .sidebar-brand .brand-text h1 a {\n            background: linear-gradient(135deg, var(--gradient-start), var(--gradient-end));\n            -webkit-background-clip: text;\n            -webkit-text-fill-color: transparent;\n            text-decoration: none;\n        }\n        .sidebar-brand .brand-text h1 a:hover { opacity: 0.85; text-decoration: none; }\n        .sidebar-brand .sub {\n            color: var(--text-faint); font-size: 10px; margin-top: 3px;\n            text-transform: uppercase; letter-spacing: 1.2px; font-weight: 500;\n        }\n\n        .sidebar-nav {\n            display: flex; flex-direction: column; gap: 1px;\n            padding: 8px 10px;\n            flex: 1;\n            overflow-y: auto;\n            overflow-x: hidden;\n            scrollbar-width: thin;\n            scrollbar-color: var(--scrollbar-thumb) transparent;\n        }\n        .sidebar-nav::-webkit-scrollbar { width: 5px; }\n        .sidebar-nav::-webkit-scrollbar-track { background: transparent; }\n        .sidebar-nav::-webkit-scrollbar-thumb {\n            background: var(--scrollbar-thumb); border-radius: 3px;\n        }\n        .sidebar-nav::         width: 100%; min-height: 70px; max-height: 300px; resize: vertical;\n            background: var(--bg-elevated); border: 1px solid var(--border-subtle);\n            color: var(--text-primary); border-radius: 8px; padding: 10px 12px;\n            font-family: 'Inter', -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, sans-serif;\n            font-size: 12px; line-height: 1.6;\n            transition: border-color 0.15s;\n        }\n        .week-notes:focus {\n            border-color: var(--accent-cyan); outline: none;\n            box-shadow: 0 0 0 2px rgba(0,188,212,0.15);\n        }\n        .week-notes::placeholder { color: var(--text-faint); }\n        .week-notes-status {\n            font-size: 10px; color: var(--text-faint); margin-top: 4px;\n            text-align: right; min-height: 14px;\n            transition: color 0.3s;\n        }\n        .week-notes-status.saved { color: var(--success); }\n\n        /* Sidebar course sub-items */\n        .nav-sub-list {\n            display: flex; flex-direction: column; gap: 1px;\n            padding: 2px 0 4px;\n            overflow: hidden; transition: max-height 0.25s ease, opacity 0.2s ease;\n            max-height: 600px; opacity: 1;\n        }\n        .nav-sub-list.collapsed {\n            max-height: 0; opacity: 0; padding: 0;\n        }\n        .nav-sub-toggle {\n            margin-left: auto; font-size: 9px; color: var(--text-faint);\n            transition: transform 0.2s; cursor: pointer; padding: 2px 4px;\n        }\n        .nav-sub-toggle.collapsed { transform: rotate(-90deg); }\n        .nav-sub-item {\n            display: flex; align-items: center; gap: 8px;\n            padding: 5px 12px 5px 36px; border-radius: 6px;\n            font-size: 12px; color: var(--text-muted);\n            cursor: pointer; transition: all 0.15s;\n            user-select: none;\n            min-width: 0;\n        }\n        .nav-sub-item:hover {\n            background: var(--bg-elevated); color: var(--text-secondary);\n        }\n        .nav-sub-item.active {\n            background: var(--accent-cyan-bg); color: var(--accent-cyan-hover);\n            font-weight: 600;\n        }\n        .nav-sub-name {\n            flex: 1; min-width: 0;\n            overflow: hidden; text-overflow: ellipsis; white-space: nowrap;\n        }\n        .nav-sub-dot {\n            width: 7px; height: 7px; border-radius: 50%;\n            flex-shrink: 0; background: var(--border-subtle);\n            transition: background 0.2s;\n        }\n        .nav-sub-dot.has-progress { background: var(--accent-cyan); }\n        .nav-sub-dot.done { background: var(--success); }\n\n        /* Category colors */\n        :root {\n            --cat-creative: #a78bfa;\n            --cat-creative-bg: rgba(167,139,250,0.12);\n            --cat-professional: #60a5fa;\n            --cat-professional-bg: rgba(96,165,250,0.12);\n            --cat-family: #f59e0b;\n            --cat-family-bg: rgba(245,158,11,0.12);\n            --cat-personal-dev: #34d399;\n            --cat-personal-dev-bg: rgba(52,211,153,0.12);\n            --cat-health: #f472b6;\n            --cat-health-bg: rgba(244,114,182,0.12);\n            --cat-learning: #38bdf8;\n            --cat-learning-bg: rgba(56,189,248,0.12);\n            --cat-finance: #fbbf24;\n            --cat-finance-bg: rgba(251,191,36,0.12);\n        }\n        /* Course filter bar */\n        .course-filter-bar {\n            display: flex; flex-wrap: wrap; gap: 8px; margin-bottom: 20px;\n        }\n        .course-filter-btn {\n            font-size: 11px; font-weight: 600; padding: 5px 14px;\n            border-radius: 20px; border: 1.5px solid var(--border-subtle);\n            background: transparent; color: var(--text-secondary);\n            cursor: pointer; transition: all 0.15s; text-transform: capitalize;\n        }\n        .course-filter-btn:hover { border-color: var(--text-muted); color: var(--text-primary); }\n        .course-filter-btn.active { color: #fff; }\n        .course-filter-btn[data-cat=\"all\"].active { background: var(--text-secondary); border-color: var(--text-secondary); }\n        .course-filter-btn[data-cat=\"creative\"].active { background: var(--cat-creative); border-color: var(--cat-creative); }\n        .course-filter-btn[data-cat=\"professional\"].active { background: var(--cat-professional); border-color: var(--cat-professional); }\n        .course-filter-btn[data-cat=\"family\"].active { background: var(--cat-family); border-color: var(--cat-family); color: #1a1a2e; }\n        .course-filter-btn[data-cat=\"personal-dev\"].active { background: var(--cat-personal-dev); border-color: var(--cat-personal-dev); color: #1a1a2e; }\n        .course-filter-btn[data-cat=\"health\"].active { background: var(--cat-health); border-color: var(--cat-health); }\n        .course-filter-btn[data-cat=\"learning\"].active { background: var(--cat-learning); border-color: var(--cat-learning); color: #1a1a2e; }\n        .course-filter-btn[data-cat=\"finance\"].active { background: var(--cat-finance); border-color: var(--cat-finance); color: #1a1a2e; }\n\n        /* Course index grid */\n        .course-index-grid {\n            display: grid; grid-template-columns: repeat(auto-fill, minmax(320px, 1fr));\n            gap: 16px;\n        }\n        .course-index-card {\n            background: var(--bg-card); border: 1px solid var(--border-default);\n            border-radius: 12px; padding: 20px;\n            cursor: pointer; transition: all 0.2s;\n            border-left: 4px solid var(--accent-cyan);\n            position: relative;\n        }\n        .course-index-card:hover {\n            transform: translateY(-2px);\n            box-shadow: 0 6px 20px var(--shadow-heavy);\n            border-color: var(--border-subtle);\n        }\n        .course-index-card.priority-high { border-left-width: 4px; }\n        .course-index-card.priority-med  { border-left-width: 3px; opacity: 0.92; }\n        .course-index-card.priority-low  { border-left-width: 2px; opacity: 0.82; }\n        /* Category border colors */\n        .course-index-card[data-cat=\"creative\"]     { border-left-color: var(--cat-creative); }\n        .course-index-card[data-cat=\"professional\"] { border-left-color: var(--cat-professional); }\n        .course-index-card[data-cat=\"family\"]       { border-left-color: var(--cat-family); }\n        .course-index-card[data-cat=\"personal-dev\"] { border-left-color: var(--cat-personal-dev); }\n        .course-index-card[data-cat=\"health\"]       { border-left-color: var(--cat-health); }\n        .course-index-card[data-cat=\"learning\"]     { border-left-color: var(--cat-learning); }\n        .course-index-card[data-cat=\"finance\"]      { border-left-color: var(--cat-finance); }\n        .course-index-card:hover[data-cat=\"creative\"]     { border-left-color: var(--cat-creative); }\n        .course-index-card:hover[data-cat=\"professional\"] { border-left-color: var(--cat-professional); }\n        .course-index-card:hover[data-cat=\"family\"]       { border-left-color: var(--cat-family); }\n        .course-index-card:hover[data-cat=\"personal-dev\"] { border-left-color: var(--cat-personal-dev); }\n        .course-index-card:hover[data-cat=\"health\"]       { border-left-color: var(--cat-health); }\n        .course-index-card:hover[data-cat=\"learning\"]     { border-left-color: var(--cat-learning); }\n        .course-index-card:hover[data-cat=\"finance\"]      { border-left-color: var(--cat-finance); }\n        /* Priority badge */\n        .course-priority-badge {\n            position: absolute; top: 10px; right: 12px;\n            font-size: 9px; font-weight: 700; letter-spacing: 0.5px;\n            padding: 2px 8px; border-radius: 4px; text-transform: uppercase;\n        }\n        .course-priority-badge.high {\n            background: linear-gradient(135deg, rgba(251,191,36,0.25), rgba(245,158,11,0.15));\n            color: #fbbf24; border: 1px solid rgba(251,191,36,0.3);\n        }\n        /* Star impact rating */\n        .course-stars {\n            display: flex; align-items: center; gap: 6px; margin-bottom: 10px;\n        }\n        .course-stars-icons {\n            font-size: 13px; letter-spacing: 1px; line-height: 1;\n        }\n        .course-stars-icons .star-filled { color: #fbbf24; }\n        .course-stars-icons .star-empty  { color: rgba(255,255,255,0.12); }\n        .course-stars-label {\n            font-size: 9px; color: var(--text-faint); text-transform: uppercase;\n            letter-spacing: 0.5px; font-weight: 600;\n        }\n        /* Category chip on card */\n        .course-cat-chip {\n            display: inline-block; font-size: 9px; font-weight: 600;\n            padding: 2px 8px; border-radius: 10px; margin-bottom: 8px;\n            text-transform: capitalize; letter-spacing: 0.3px;\n        }\n        .course-cat-chip[data-cat=\"creative\"]     { background: var(--cat-creative-bg); color: var(--cat-creative); }\n        .course-cat-chip[data-cat=\"professional\"] { background: var(--cat-professional-bg); color: var(--cat-professional); }\n        .course-cat-chip[data-cat=\"family\"]       { background: var(--cat-family-bg); color: var(--cat-family); }\n        .course-cat-chip[data-cat=\"personal-dev\"] { background: var(--cat-personal-dev-bg); color: var(--cat-personal-dev); }\n        .course-cat-chip[data-cat=\"health\"]       { background: var(--cat-health-bg); color: var(--cat-health); }\n        .course-cat-chip[data-cat=\"learning\"]     { background: var(--cat-learning-bg); color: var(--cat-learning); }\n        .course-cat-chip[data-cat=\"finance\"]      { background: var(--cat-finance-bg); color: var(--cat-finance); }\n        .course-index-title {\n            font-size: 16px; font-weight: 700; color: var(--text-primary);\n            margin-bottom: 4px;\n        }\n        .course-index-subtitle {\n            font-size: 12px; color: var(--text-muted); margin-bottom: 12px;\n        }\n        .course-index-tags {\n            display: flex; flex-wrap: wrap; gap: 5px; margin-bottom: 14px;\n        }\n        .course-index-tag {\n            font-size: 10px; padding: 2px 7px; border-radius: 4px;\n            background: var(--accent-cyan-bg); color: var(--accent-cyan-hover);\n        }\n        .course-index-progress {\n            display: flex; align-items: center; gap: 10px;\n        }\n        .course-index-bar {\n            flex: 1; height: 5px; background: var(--bg-elevated);\n            border-radius: 3px; overflow: hidden;\n        }\n        .course-index-fill {\n            height: 100%; border-radius: 3px;\n            background: linear-gradient(90deg, var(--gradient-start), var(--gradient-end));\n        }\n        .course-index-label {\n            font-size: 11px; color: var(--text-muted); min-width: 55px; text-align: right;\n        }\n\n        /* Course back link */\n        .course-back {\n            display: inline-flex; align-items: center; gap: 6px;\n            font-size: 13px; color: var(--text-muted); margin-bottom: 20px;\n            cursor: pointer; transition: color 0.15s;\n        }\n        .course-back:hover { color: var(--accent-cyan-hover); text-decoration: none; }\n\n        /* Materials */\n        .course-materials {\n            padding: 0 24px 24px;\n        }\n        .materials-title {\n            font-size: 13px; font-weight: 600; color: var(--text-muted);\n            text-transform: uppercase; letter-spacing: 1px;\n            padding: 0 0 14px;\n            border-top: 1px solid var(--border-default);\n            padding-top: 20px;\n        }\n        .materials-grid {\n            display: grid; grid-template-columns: repeat(auto-fill, minmax(240px, 1fr));\n            gap: 10px;\n        }\n        a.material-item, .material-item {\n            background: var(--bg-elevated); border: 1px solid var(--border-subtle);\n            border-radius: 8px; padding: 12px;\n            transition: transform 0.1s, border-color 0.1s;\n            text-decoration: none; display: block;\n        }\n        a.material-item:hover { transform: translateY(-1px); border-color: var(--accent-purple); cursor: pointer; }\n        .material-item:hover { transform: translateY(-1px); }\n        .material-top {\n            display: flex; justify-content: space-between;\n            align-items: center; margin-bottom: 6px;\n        }\n        .material-name {\n            font-size: 13px; font-weight: 600; color: var(--text-primary);\n        }\n        .material-type {\n            font-size: 9px; font-weight: 600; text-transform: uppercase;\n            letter-spacing: 0.5px; padding: 2px 6px; border-radius: 3px;\n        }\n        .material-type.folder { background: var(--info-bg); color: var(--info); }\n        .material-type.tool { background: var(--accent-cyan-bg); color: #2dd4bf; }\n        .material-type.guide { background: var(--accent-cyan-bg); color: var(--accent-cyan-hover); }\n        .material-type.template { background: var(--accent-purple-bg); color: #60a5fa; }\n        .material-notes {\n            font-size: 11px; color: var(--text-muted); line-height: 1.4;\n        }\n        .material-path {\n            font-size: 10px; color: var(--text-faint); margin-top: 4px;\n            font-family: 'Cascadia Code', 'Fira Code', monospace;\n        }\n\n        /* Progress bar */\n        .course-progress {\n            margin: 12px 0 0;\n            display: flex; align-items: center; gap: 12px;\n        }\n        .progress-bar {\n            flex: 1; height: 6px; background: var(--bg-elevated);\n            border-radius: 3px; overflow: hidden;\n        }\n        .progress-fill {\n            height: 100%; border-radius: 3px;\n            background: linear-gradient(90deg, var(--gradient-start), var(--gradient-end));\n            transition: width 0.3s;\n        }\n        .progress-label {\n            font-size: 12px; color: var(--text-muted); min-width: 60px; text-align: right;\n        }\n\n        .footer {\n            text-align: center; color: var(--text-faint); font-size: 12px;\n            margin-top: 32px; padding-top: 16px; border-top: 1px solid var(--border-default);\n        }\n        .footer a { color: var(--text-muted); }\n        .footer a:hover { color: var(--text-secondary); }\n\n        /* Memories page */\n        .memory-grid {\n            display: grid; grid-template-columns: repeat(2, 1fr);\n            gap: 16px; margin-bottom: 32px;\n        }\n        .memory-card {\n            background: var(--bg-card); border: 1px solid var(--border-default);\n            border-radius: 12px; border-left: 3px solid var(--accent-cyan);\n            padding: 20px; display: flex; flex-direction: column;\n        }\n        .memory-card-header {\n            display: flex; align-items: center; gap: 10px;\n            margin-bottom: 16px; padding-bottom: 12px;\n            border-bottom: 1px solid var(--border-default);\n        }\n        .memory-card-icon { font-size: 18px; }\n        .memory-card-title {\n            font-size: 16px; font-weight: 700; color: var(--text-primary); flex: 1;\n        }\n        .memory-card-count {\n            background: var(--bg-elevated); padding: 2px 8px; border-radius: 10px;\n            font-size: 11px; color: var(--text-muted); font-weight: 600;\n        }\n        .memory-bullet-list {\n            flex: 1; max-height: 400px; overflow-y: auto;\n            display: flex; flex-direction: column; gap: 0;\n        }\n        .memory-bullet {\n            font-size: 13px; color: var(--text-secondary); line-height: 1.6;\n            padding: 8px 0 8px 16px; position: relative;\n            border-bottom: 1px solid var(--border-default);\n        }\n        .memory-bullet:last-child { border-bottom: none; }\n        .memory-bullet::before {\n            content: ''; position: absolute; left: 0; top: 14px;\n            width: 6px; height: 6px; border-radius: 50%;\n            background: var(--border-subtle);\n        }\n        .memory-card-link {\n            margin-top: 12px; padding-top: 12px;\n            border-top: 1px solid var(--border-default);\n            font-size: 12px; color: var(--accent-cyan);\n        }\n        .memory-card-link:hover { color: var(--accent-cyan-hover); }\n\n        /* Memory editing */\n        .memory-bullet {\n            display: flex; align-items: flex-start; gap: 8px;\n        }\n        .memory-bullet-text { flex: 1; }\n        .memory-bullet-delete {\n            background: none; border: none; color: var(--border-subtle);\n            cursor: pointer; font-size: 16px; line-height: 1;\n            padding: 0 4px; border-radius: 4px;\n            opacity: 0; transition: opacity 0.15s, color 0.15s;\n            flex-shrink: 0; font-family: inherit;\n        }\n        .memory-bullet:hover .memory-bullet-delete { opacity: 1; }\n        .memory-bullet-delete:hover { color: var(--danger); background: rgba(239,68,68,0.1); }\n        .memory-bullet.deleted {\n            text-decoration: line-through; color: var(--text-faint); opacity: 0.5;\n        }\n        .memory-bullet.deleted .memory-bullet-delete { display: none; }\n        .memory-bullet.pending {\n            border-left: 2px solid var(--accent-cyan);\n            background: rgba(0,188,212,0.05);\n            padding-left: 14px;\n        }\n        .memory-add-form {\n            display: flex; gap: 8px; margin-top: 12px;\n            padding-top: 12px; border-top: 1px solid var(--border-default);\n        }\n        .memory-add-input {\n            flex: 1; background: var(--bg-elevated); border: 1px solid var(--border-subtle);\n            color: var(--text-primary); border-radius: 8px; padding: 8px 12px;\n            font-size: 12px; font-family: inherit;\n        }\n        .memory-add-input:focus {\n            border-color: var(--accent-cyan); outline: none;\n            box-shadow: 0 0 0 2px rgba(0,188,212,0.15);\n        }\n r: var(--text-primary);\n            margin-bottom: 8px;\n        }\n        .briefing-summary {\n            color: var(--text-secondary); font-size: 14px; line-height: 1.6;\n        }\n        .briefing-stats {\n            display: grid; grid-template-columns: repeat(4, 1fr);\n            gap: 12px; margin-bottom: 24px;\n        }\n        .briefing-stat {\n            background: var(--bg-card); border: 1px solid var(--border-default);\n            border-radius: 10px; padding: 14px; text-align: center;\n        }\n        .briefing-stat .number { font-size: 28px; font-weight: 700; }\n        .briefing-stat .label {\n            color: var(--text-muted); font-size: 11px;\n            text-transform: uppercase; letter-spacing: 1px; margin-top: 2px;\n        }\n\n        .briefing-day {\n            background: var(--bg-card); border: 1px solid var(--border-default);\n            border-radius: 16px; margin-bottom: 16px; overflow: hidden;\n            box-shadow: 0 2px 8px var(--shadow-color);\n        }\n        .briefing-day-header {\n            display: flex; justify-content: space-between; align-items: center;\n            padding: 14px 20px; cursor: pointer;\n            border-bottom: 1px solid var(--border-default);\n        }\n        .briefing-day-header:hover { background: var(--bg-elevated); }\n        .briefing-day-title {\n            display: flex; align-items: center; gap: 12px;\n        }\n        .briefing-day-name {\n            font-size: 16px; font-weight: 700; color: var(--text-primary);\n        }\n        .briefing-day-theme {\n            color: var(--text-muted); font-size: 13px;\n        }\n        .briefing-energy {\n            font-size: 11px; font-weight: 600; text-transform: uppercase;\n            letter-spacing: 1px; padding: 3px 10px; border-radius: 6px;\n        }\n        .briefing-energy.HIGH { background: var(--warning-bg); color: var(--warning-text); }\n        .briefing-energy.MEDIUM { background: var(--bg-elevated); color: var(--text-secondary); }\n        .briefing-energy.LOW { background: var(--success-bg); color: var(--success-text); }\n        .briefing-day-chevron {\n            color: var(--text-faint); transition: transform 0.2s; font-size: 14px;\n        }\n        .briefing-day.open .briefing-day-chevron { transform: rotate(90deg); }\n\n        .briefing-day-body {\n            display: none; padding: 0;\n        }\n        .briefing-day.open .briefing-day-body { display: block; }\n\n        .briefing-event {\n            display: flex; gap: 16px; padding: 12px 20px;\n            border-bottom: 1px solid var(--border-default);\n        }\n        .briefing-event:last-child { border-bottom: none; }\n        .briefing-event-time {\n            font-size: 13px; color: var(--text-muted); min-width: 48px;\n            font-weight: 600; padding-top: 1px;\n            font-family: 'Cascadia Code', 'Fira Code', monospace;\n        }\n        .briefing-event-body { flex: 1; }\n        .briefing-event-title { font-size: 14px; font-weight: 600; color: var(--text-primary); }\n        .briefing-event-prep {\n            font-size: 12px; color: var(--text-secondary); margin-top: 6px; line-height: 1.6;\n        }\n        .briefing-event-cat {\n            display: inline-block; font-size: 10px; font-weight: 600;\n            text-transform: uppercase; letter-spacing: 0.8px;\n            padding: 2px 8px; border-radius: 4px; margin-left: 8px;\n            vertical-align: middle;\n        }\n        .cat-dioe-baseline { background: var(--accent-cyan-deep); color: var(--accent-cyan-hover); }\n        .cat-strategic { background: var(--accent-cyan-bg); color: var(--accent-cyan); }\n        .cat-one-on-one { background: var(--success-bg); color: var(--success); }\n        .cat-external { background: var(--warning-bg); color: #fdba74; }\n        .cat-standup { background: var(--bg-elevated); color: var(--text-secondary); }\n        .cat-community { background: var(--accent-cyan-deep); color: #6        transition: all 0.15s;\n        }\n        .action-item-check.checked {\n            background: var(--accent-cyan); border-color: var(--accent-cyan); color: #fff;\n        }\n        .action-item-check.checked + span {\n            text-decoration: line-through; color: var(--text-faint);\n        }\n\n        /* --- Additional Light-theme overrides for main dashboard --- */\n        [data-theme=\"light\"] .week-detail { background: #f8fafc; }\n        [data-theme=\"light\"] .week-exercise-item { border-bottom-color: #e2e8f0; }\n        [data-theme=\"light\"] .week-checkpoint { border-color: #d97706; }\n        [data-theme=\"light\"] .course-stars-icons .star-empty { color: rgba(0,0,0,0.12); }\n        [data-theme=\"light\"] .memory-bullet { border-bottom-color: #e2e8f0; }\n        [data-theme=\"light\"] .cat-external { background: var(--warning-bg); color: #c2410c; }\n        [data-theme=\"light\"] .cat-community { background: var(--accent-cyan-bg); color: #0891b2; }\n        [data-theme=\"light\"] .material-type.tool { color: #0d9488; }\n        [data-theme=\"light\"] .material-type.template { color: #2563eb; }\n        [data-theme=\"light\"] .course-filter-btn.active { color: #fff; }\n        [data-theme=\"light\"] .course-filter-btn[data-cat=\"family\"].active { color: #1e293b; }\n        [data-theme=\"light\"] .course-filter-btn[data-cat=\"personal-dev\"].active { color: #1e293b; }\n        [data-theme=\"light\"] .course-filter-btn[data-cat=\"learning\"].active { color: #1e293b; }\n        [data-theme=\"light\"] .course-filter-btn[data-cat=\"finance\"].active { color: #1e293b; }\n\n/* === Home Page v2 === */\n.hm-welcome {\n    margin-bottom: 10px;\n}\n.hm-greeting {\n    font-family: 'Space Grotesk', sans-serif;\n    font-size: 28px;\n    font-weight: 700;\n    background: linear-gradient(135deg, var(--accent-cyan), var(--accent-purple));\n    -webkit-background-clip: text;\n    -webkit-text-fill-color: transparent;\n    background-clip: text;\n    margin: 0 0 4px 0;\n}\n.hm-date {\n    font-size: 13px;\n    color: var(--text-secondary);\n    font-weight: 500;\n}\n.hm-accent-line {\n    height: 3px;\n    margin-top: 12px;\n    border-radius: 2px;\n    background: linear-gradient(90deg, var(--accent-cyan), var(--accent-purple), transparent);\n    animation: hm-shimmer 3s ease-in-out infinite;\n}\n@keyframes hm-shimmer { 0%,100%{opacity:.7} 50%{opacity:1} }\n\n/* Quick nav strip (top) */\n.hm-nav-strip {\n    display: flex;\n    flex-wrap: wrap;\n    gap: 8px;\n    margin: 16px 0 22px 0;\n}\n.hm-nav-chip {\n    background: var(--bg-card);\n    border: 1px solid var(--border);\n    border-radius: 8px;\n    padding: 7px 12px;\n    font-size: 12px;\n    font-weight: 600;\n    color: var(--text-secondary);\n    cursor: pointer;\n    transition: all 0.2s;\n    display: flex;\n    align-items: center;\n    gap: 5px;\n}\n.hm-nav-chip:hover {\n    border-color: var(--accent-cyan);\n    color: var(--accent-cyan);\n    transform: translateY(-1px);\n    box-shadow: 0 4px 12px rgba(0,188,212,0.15);\n}\n.hm-nav-chip svg { width: 13px; height: 13px; }\n.hm-nav-chip .hm-chip-badge {\n    background: var(--accent-cyan);\n    color: #fff;\n    font-size: 10px;\n    padding: 1px 6px;\n    border-radius: 10px;\n    font-weight: 700;\n}\n\n/* Two-column chart rows */\n.hm-row {\n    display: grid;\n    grid-template-columns: 1fr 1fr;\n    gap: 20px;\n    margin-bottom: 20px;\n}\n.hm-panel {\n    background: var(--bg-card);\n    border: 1px solid var(--border);\n    border-radius: 14px;\n    padding: 22px 24px;\n    position: relative;\n    overflow: hidden;\n}\n.hm-panel-title {\n    font-family: 'Space Grotesk', sans-serif;\n    font-size: 13px;\n    font-weight: 600;\n    color: var(--text-secondary);\n    text-transform: uppercase;\n    letter-spacing: 0.6px;\n    margin-bottom: 16px;\n    display: flex;\n    align-items: center;\n    gap: 8px;\n}\n.hm-panel-title svg { width: 16px; height: 16px; color: var(--accent-cyan); }\n.hm-panel-click { cursor: pointer; transition: transform 0.2s, box-shadow 0.2s; }\n.hm-panel-click:hover { transform: translateY(-2px); box-shadow: 0 8px 24px rgba(0,0,0,0.15); }\n\n/* Donut chart */\n.hm-donut-wrap {\n    display: flex;\n    align-items: center;\n    gap: 24px;\n}\n.hm-donut-svg { width: 130px; height: 130px; flex-shrink: 0; transform: rotate(-90deg); }\n.hm-donut-seg { transition: stroke-dasharray 0.6s ease; }\n.hm-donut-pct {\n    font-family: 'Space Grotesk', sans-serif;\n    font-size: 22px;\n    font-weight: 700;\n    fill: var(--text-primary);\n    transform: rotate(90deg);\n    transform-origin: center;\n}\n.hm-donut-label {\n    font-size: 10px;\n    fill: var(--text-secondary);\n    text-transform: uppercase;\n    letter-spacing: 0.5px;\n    transform: rotate(90deg);\n    transform-origin: center;\n}\n.hm-donut-legend {\n    display: flex;\n    flex-direction: column;\n    gap: 8px;\n}\n.hm-legend-item {\n    display: flex;\n    align-items: center;\n    gap: 8px;\n    font-size: 13px;\n    color: var(--text-primary);\n}\n.hm-legend-dot {\n    width: 10px;\n    height: 10px;\n    border-radius: 50%;\n    flex-shrink: 0;\n}\n.hm-legend-num {\n    font-weight: 700;\n    font-family: 'Space Grotesk', sans-serif;\n    min-width: 20px;\n}\n\n/* Radar chart */\n.hm-radar-wrap {\n    display: flex;\n    flex-direction: column;\n    align-items: center;\n}\n.hm-radar-svg { width: 100%; max-width: 220px; height: auto; display: block; }\n.hm-radar-fill { fill: rgba(0,188,212,0.12); }\n.hm-radar-stroke { fill: none; stroke: var(--accent-cyan); stroke-width: 1.8; }\n.hm-radar-dot { fill: var(--accent-cyan); }\n.hm-radar-label { font-size: 9px; fill: var(--text-secondary); font-weight: 600; }\n.hm-radar-val { font-size: 8px; fill: var(--accent-cyan); font-weight: 700; }\n.hm-radar-method {\n    font-size: 10px;\n    color: var(--text-secondary);\n    text-align: center;\n    margin-top: 10px;\n    line-height: 1.4;\n    font-style: italic;\n}\n[data-theme=\"light\"] .hm-radar-fill { fill: rgba(0,188,212,0.15); }\n\n/* Energy bars */\n.hm-energy-row {\n    display: grid;\n    grid-template-columns: 32px 1fr 32px 1fr;\n    gap: 8px;\n    align-items: center;\n    margin-bottom: 6px;\n}\n.hm-energy-day {\n    font-size: 11px;\n    font-weight: 600;\n    color: var(--text-secondary);\n    text-transform: uppercase;\n}\n.hm-energy-track {\n    height: 8px;\n    background: var(--border);\n    border-radius: 4px;\n    overflow: hidden;\n}\n.hm-energy-fill {\n    height: 100%;\n    border-radius: 4px;\n    transition: width 0.4s ease;\n}\n.hm-energy-badge {\n    font-size: 11px;\n    font-weight: 700;\n    color: var(--text-primary);\n    background: var(--border);\n    border-radius: 10px;\n    width: 26px;\n    height: 18px;\n    display: flex;\n    align-items: center;\n    justify-content: center;\n}\n.hm-energy-theme {\n    font-size: 11px;\n    color: var(--text-secondary);\n    overflow: hidden;\n    text-overflow: ellipsis;\n    white-space: nowrap;\n}\n.hm-energy-empty {\n    font-size: 13px;\n    color: var(--text-secondary);\n    font-style: italic;\n    padding: 12px 0;\n}\n\n/* Funnel */\n.hm-funnel-row {\n    display: grid;\n    grid-template-columns: 72px 1fr;\n    gap: 10px;\n    align-items: center;\n    margin-bottom: 8px;\n}\n.hm-funnel-label {\n    font-size: 11px;\n    font-weight: 600;\n    color: var(--text-secondary);\n    text-align: right;\n}\n.hm-funnel-track {\n    height: 22px;\n    background: var(--border);\n    border-radius: 6px;\n    overflow: hidden;\n    position: relative;\n}\n.hm-funnel-fill {\n    height: 100%;\n    border-radius: 6px;\n    display: flex;\n    align-items: center;\n    padding-left: 10px;\n    transition: width 0.5s ease;\n    min-width: 28px;\n}\n.hm-funnel-count {\n    font-size: 11px;\n    font-weight: 700;\n    color: #fff;\n    text-shadow: 0 1px 2px rgba(0,0,0,0.3);\n}\n\n/* Universe chips */\n.hm-uni-chip {\n    display: inline-flex;\n    align-items: center;\n   var raw = b64ToBytes(VAULT_BLOB);
  var salt = raw.slice(0, VAULT_SALT_LEN);
  var iv = raw.slice(VAULT_SALT_LEN, VAULT_SALT_LEN + VAULT_IV_LEN);
  var ct = raw.slice(VAULT_SALT_LEN + VAULT_IV_LEN);

  var enc = new TextEncoder();
  var keyMaterial = await crypto.subtle.importKey(
    "raw", enc.encode(passphrase), "PBKDF2", false, ["deriveKey"]
  );
  var key = await crypto.subtle.deriveKey(
    { name: "PBKDF2", salt: salt, iterations: VAULT_ITERATIONS, hash: "SHA-256" },
    keyMaterial,
    { name: "AES-GCM", length: 256 },
    false, ["decrypt"]
  );
  var decrypted = await crypto.subtle.decrypt(
    { name: "AES-GCM", iv: iv }, key, ct
  );
  return new TextDecoder().decode(decrypted);
}

async function vaultUnlock() {
  var pass = document.getElementById("vault-pass").value;
  if (!pass) return;
  var btn = document.getElementById("vault-btn");
  var inp = document.getElementById("vault-pass");
  var err = document.getElementById("vault-error");
  btn.disabled = true;
  btn.textContent = "Decrypting...";
  err.textContent = "";
  inp.classList.remove("error");

  try {
    var body = await vaultDecrypt(pass);
    if (document.getElementById("vault-remember").checked) {
      localStorage.setItem(VAULT_KEY, pass);
    }
    var fullHtml = "<!DOCTYPE html><html lang=\"en\"><head>" +
      VAULT_HEAD + "</head><body>" + body + "</body></html>";
    var blob = new Blob([fullHtml], {type: "text/html; charset=utf-8"});
    location.replace(URL.createObjectURL(blob));
  } catch(e) {
    inp.classList.add("error");
    err.textContent = "Wrong passphrase";
    btn.disabled = false;
    btn.textContent = "Unlock";
    inp.focus();
    inp.select();
  }
}

// Auto-unlock if passphrase saved in localStorage
(async function() {
  var saved = localStorage.getItem(VAULT_KEY);
  if (saved) {
    try {
      var body = await vaultDecrypt(saved);
      var fullHtml = "<!DOCTYPE html><html lang=\"en\"><head>" +
        VAULT_HEAD + "</head><body>" + body + "</body></html>";
      var blob = new Blob([fullHtml], {type: "text/html; charset=utf-8"});
      location.replace(URL.createObjectURL(blob));
    } catch(e) {
      localStorage.removeItem(VAULT_KEY);
    }
  }
})();

document.getElementById("vault-pass").addEventListener("keydown", function(e) {
  if (e.key === "Enter") vaultUnlock();
});
</script>
